PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE user (
	id INTEGER NOT NULL, 
	firstname VARCHAR(150), 
	lastname VARCHAR(150), 
	email VARCHAR(150), 
	dob DATETIME, 
	username VARCHAR(150), 
	password VARCHAR(150), 
	date_created DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (email), 
	UNIQUE (username)
);
CREATE TABLE dish (
	id INTEGER NOT NULL, 
	name VARCHAR(150), 
	"pictureURL" VARCHAR(1000), 
	"numServings" INTEGER, 
	"servingSize" VARCHAR(150), 
	"cookTime" VARCHAR(10), 
	"prepTime" VARCHAR(10), 
	"cookTemp" VARCHAR(5), 
	"notionID" VARCHAR(50), 
	date_created DATETIME, 
	update_time DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (name), 
	UNIQUE ("notionID")
);
CREATE TABLE facility (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	address VARCHAR(100), 
	city VARCHAR(50), 
	state VARCHAR(2), 
	zip VARCHAR(10), 
	phone VARCHAR(20), 
	type VARCHAR(50), 
	userid INTEGER NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE allergies (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	reaction VARCHAR(50), 
	dateadded DATE NOT NULL, 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE goals (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	pictureurl VARCHAR(500), 
	status VARCHAR(50), 
	measurement VARCHAR(500), 
	datestart DATETIME, 
	dateend DATETIME, 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE projects (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	pictureurl VARCHAR(500), 
	status VARCHAR(50), 
	last_reviewed DATETIME, 
	when_review INTEGER, 
	notionid VARCHAR(50), 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE recipe (
	id INTEGER NOT NULL, 
	qty VARCHAR(10), 
	measurement VARCHAR(50), 
	ing VARCHAR(150), 
	catagory VARCHAR(50), 
	notes VARCHAR(250), 
	fat_total INTEGER, 
	weight INTEGER, 
	fat_sat INTEGER, 
	fat_trans INTEGER, 
	cholesterol INTEGER, 
	sodium INTEGER, 
	potassium INTEGER, 
	carb_total INTEGER, 
	carb_fiber INTEGER, 
	carb_sugar INTEGER, 
	protein INTEGER, 
	servsize VARCHAR(100), 
	calories INTEGER, 
	calories_fat INTEGER, 
	"pictureURL" VARCHAR(500), 
	date_created DATETIME, 
	dishfk INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(dishfk) REFERENCES dish (id) ON DELETE CASCADE
);
CREATE TABLE steps (
	id INTEGER NOT NULL, 
	step_num INTEGER, 
	step_text TEXT, 
	date_created DATETIME, 
	dishfk INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(dishfk) REFERENCES dish (id) ON DELETE CASCADE
);
CREATE TABLE planner (
	id INTEGER NOT NULL, 
	date DATETIME, 
	item VARCHAR(200), 
	dishfk INTEGER, 
	update_time DATETIME, 
	date_created DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(dishfk) REFERENCES dish (id) ON DELETE CASCADE
);
CREATE TABLE doctor (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	address VARCHAR(100), 
	city VARCHAR(50), 
	state VARCHAR(2), 
	zip VARCHAR(10), 
	phone VARCHAR(15), 
	email VARCHAR(100), 
	asst VARCHAR(100), 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	facilityfk INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(facilityfk) REFERENCES facility (id) ON DELETE CASCADE
);
CREATE TABLE tasks (
	id INTEGER NOT NULL, 
	item VARCHAR(500), 
	checked BOOLEAN, 
	userid INTEGER NOT NULL, 
	duedate DATETIME, 
	update_time DATETIME, 
	date_created DATETIME, 
	goalfk INTEGER, 
	project INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(goalfk) REFERENCES goals (id) ON DELETE CASCADE, 
	FOREIGN KEY(project) REFERENCES projects (id) ON DELETE CASCADE
);
CREATE TABLE hosptial (
	id INTEGER NOT NULL, 
	datestart DATE NOT NULL, 
	dateend DATE NOT NULL, 
	reason VARCHAR(100), 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	doctorfk INTEGER NOT NULL, 
	facilityfk INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(doctorfk) REFERENCES doctor (id) ON DELETE CASCADE, 
	FOREIGN KEY(facilityfk) REFERENCES facility (id) ON DELETE CASCADE
);
CREATE TABLE surgeries (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	date DATE NOT NULL, 
	description VARCHAR(500), 
	body_part VARCHAR(50), 
	age INTEGER, 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	doctorfk INTEGER NOT NULL, 
	facilityfk INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(doctorfk) REFERENCES doctor (id) ON DELETE CASCADE, 
	FOREIGN KEY(facilityfk) REFERENCES facility (id) ON DELETE CASCADE
);
CREATE TABLE medications (
	id INTEGER NOT NULL, 
	name VARCHAR(100), 
	dose VARCHAR(50), 
	how_often VARCHAR(100), 
	num_filled_days INTEGER, 
	reason_for_taking VARCHAR(100), 
	pharmacy VARCHAR(100), 
	last_refilled DATETIME, 
	next_refill DATETIME, 
	userid INTEGER NOT NULL, 
	update_time DATETIME, 
	date_created DATETIME, 
	doctorfk INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(doctorfk) REFERENCES doctor (id) ON DELETE CASCADE
);
COMMIT;
